import React from 'react';
import './App.css';
/* router */
import { BrowserRouter as Router,Switch, Redirect,Route } from 'react-router-dom';

import Admin from './Features/Admin/Admin';

function App () {
  return (

    <Router>
      <div className="App">
        <Switch >
          <Route path={ '/' }>
            <Redirect to='/admin'></Redirect>
          </Route>
          <Admin path='/admin'></Admin>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
